import React, { useState, useEffect } from 'react';

const AdminDashboard = () => {
  const [pendingItems, setPendingItems] = useState([]);
  const [approvedItems, setApprovedItems] = useState([]);
  const [startTime, setStartTime] = useState(null); // Auction start time
  const [endTime, setEndTime] = useState(null); // Auction end time
  const [countdown, setCountdown] = useState(null); // Countdown timer
  const [currentTime, setCurrentTime] = useState(new Date()); // Current time for digital clock

  // Update current time every second for the digital clock
  useEffect(() => {
    const clockInterval = setInterval(() => {
      setCurrentTime(new Date());
    }, 1000);
    return () => clearInterval(clockInterval);
  }, []);

  // Update countdown every second if start and end times are set
  useEffect(() => {
    if (startTime && endTime) {
      const timer = setInterval(() => {
        const now = new Date();
        const end = new Date(endTime);
        const remainingTime = end - now;

        if (remainingTime > 0) {
          const hours = Math.floor((remainingTime / (1000 * 60 * 60)) % 24);
          const minutes = Math.floor((remainingTime / (1000 * 60)) % 60);
          const seconds = Math.floor((remainingTime / 1000) % 60);
          setCountdown(`${hours}h ${minutes}m ${seconds}s`);
        } else {
          setCountdown("Auction has ended");
          clearInterval(timer);
        }
      }, 1000);

      return () => clearInterval(timer);
    }
  }, [startTime, endTime]);

  const approveItem = (item) => {
    setApprovedItems([...approvedItems, item]);
    setPendingItems(pendingItems.filter((i) => i.id !== item.id));
  };

  const rejectItem = (item) => {
    setPendingItems(pendingItems.filter((i) => i.id !== item.id));
  };

  return (
    <div className="container mx-auto p-6">
      <h1 className="text-3xl font-semibold">Admin Dashboard</h1>

      {/* Digital Clock */}
      <div className="mt-6 text-2xl font-semibold">
        Current Time: {currentTime.toLocaleTimeString()}
      </div>

      {/* Auction Time Input */}
      <div className="mt-6">
        <h2 className="text-2xl font-medium">Set Auction Times</h2>
        <div className="flex gap-4 mt-4">
          <div>
            <label className="block font-semibold">Start Time:</label>
            <input
              type="datetime-local"
              value={startTime}
              onChange={(e) => setStartTime(e.target.value)}
              className="border p-2 rounded"
            />
          </div>
          <div>
            <label className="block font-semibold">End Time:</label>
            <input
              type="datetime-local"
              value={endTime}
              onChange={(e) => setEndTime(e.target.value)}
              className="border p-2 rounded"
            />
          </div>
        </div>
      </div>

      {/* Countdown Timer */}
      <div className="mt-6 text-2xl font-medium">
        {countdown ? `Time Remaining: ${countdown}` : "Set start and end times for the countdown"}
      </div>

      {/* Auction Approval Section */}
      <h2 className="text-2xl font-medium mt-6">Pending Auctions</h2>
      <div className="mt-4">
        {pendingItems.length === 0 ? (
          <p>No pending auctions.</p>
        ) : (
          <ul>
            {pendingItems.map((item) => (
              <li key={item.id} className="border p-4 mb-4">
                <h4 className="font-bold">{item.name}</h4>
                <p>{item.description}</p>
                <button onClick={() => approveItem(item)} className="bg-green-600 text-white p-2 rounded mr-2">
                  Approve
                </button>
                <button onClick={() => rejectItem(item)} className="bg-red-600 text-white p-2 rounded">
                  Reject
                </button>
              </li>
            ))}
          </ul>
        )}
      </div>

      {/* Approved Auctions Section */}
      <h2 className="text-2xl font-medium mt-6">Approved Auctions</h2>
      <div className="mt-4">
        {approvedItems.length === 0 ? (
          <p>No approved auctions.</p>
        ) : (
          <ul>
            {approvedItems.map((item) => (
              <li key={item.id} className="border p-4 mb-4">
                <h4 className="font-bold">{item.name}</h4>
                <p>{item.description}</p>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
